import React from 'react';
import './ExperienceSection.css';
import SectionContent from '../Section-Content/Section-Content';


function ExperienceSection ({ number, text }) {
    return (
      <div className="ExperienceSection">
        <h3 className="flex"><span>{number}&nbsp;</span> {text}</h3>
        <SectionContent title="Computer Science and Business Graduate" description="Graduated as a first generation student with dual degrees in Business and Computing"/>
      </div>
    );
}

export default ExperienceSection
